import React, { useState, useContext } from "react";
import { Link, useNavigate } from "react-router-dom";
import { AuthContext } from "../../context/AuthContext";
import "Navbar.css";

const Navbar = () => {
  const { user, logout } = useContext(AuthContext);
  const navigate = useNavigate();
  const [open, setOpen] = useState(false);

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <nav className="bg-blue-600 text-white shadow-md">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-16 items-center">
          <div className="flex-shrink-0 font-bold text-xl">
            <Link to="/">Gram Panchayat</Link>
          </div>

          {/* Desktop Menu */}
          <div className="hidden md:flex space-x-6 items-center">
            <Link className="hover:text-gray-200" to="/">Home</Link>
            <Link className="hover:text-gray-200" to="/about">About</Link>
            <Link className="hover:text-gray-200" to="/services">Services</Link>
            <Link className="hover:text-gray-200" to="/schemes">Schemes</Link>
            <Link className="hover:text-gray-200" to="/notices">Notices</Link>
            <Link className="hover:text-gray-200" to="/development">Development</Link>
            <Link className="hover:text-gray-200" to="/gallery">Gallery</Link>
            <Link className="hover:text-gray-200" to="/contact">Contact</Link>

            {user ? (
              <>
                <Link className="hover:text-gray-200" to="/apply-service">Apply Service</Link>
                <Link className="hover:text-gray-200" to="/application-status">My Applications</Link>
                <button
                  onClick={handleLogout}
                  className="bg-red-500 px-3 py-1 rounded hover:bg-red-600"
                >
                  Logout
                </button>
              </>
            ) : (
              <>
                <Link className="hover:text-gray-200" to="/login">Login</Link>
                <Link className="hover:text-gray-200" to="/register">Register</Link>
              </>
            )}
          </div>

          {/* Mobile Menu Button */}
          <div className="md:hidden flex items-center">
            <button onClick={() => setOpen(!open)}>
              <svg
                className="w-6 h-6"
                fill="none"
                stroke="currentColor"
                viewBox="0 0 24 24"
              >
                {open ? (
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M6 18L18 6M6 6l12 12" />
                ) : (
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16M4 18h16" />
                )}
              </svg>
            </button>
          </div>
        </div>
      </div>

      {/* Mobile Menu */}
      {open && (
        <div className="md:hidden bg-blue-500 px-4 pt-2 pb-4 space-y-1">
          <Link className="block hover:text-gray-200" to="/">Home</Link>
          <Link className="block hover:text-gray-200" to="/about">About</Link>
          <Link className="block hover:text-gray-200" to="/services">Services</Link>
          <Link className="block hover:text-gray-200" to="/schemes">Schemes</Link>
          <Link className="block hover:text-gray-200" to="/notices">Notices</Link>
          <Link className="block hover:text-gray-200" to="/development">Development</Link>
          <Link className="block hover:text-gray-200" to="/gallery">Gallery</Link>
          <Link className="block hover:text-gray-200" to="/contact">Contact</Link>

          {user ? (
            <>
              <Link className="block hover:text-gray-200" to="/apply-service">Apply Service</Link>
              <Link className="block hover:text-gray-200" to="/application-status">My Applications</Link>
              <button
                onClick={handleLogout}
                className="w-full text-left bg-red-500 px-3 py-1 rounded hover:bg-red-600"
              >
                Logout
              </button>
            </>
          ) : (
            <>
              <Link className="block hover:text-gray-200" to="/login">Login</Link>
              <Link className="block hover:text-gray-200" to="/register">Register</Link>
            </>
          )}
        </div>
      )}
    </nav>
  );
};

export default Navbar;
